def my_func(input1: str) -> int:
    # Convert the input string to a list of integers
    numbers = list(map(int, input1.strip('[]').split()))

    count = 0  # Initialize the count of non-negative numbers

    for num in numbers:
        if num < 0:
            return count  # Return the count once a negative number is encountered
        count += 1  # Increment count for each non-negative number

    return count  # Return the count if no negative number is found
